import React from "react";
import "./Navbar.scss";
import Logo from "../../assets/Ear_Health.svg";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="container">
        <div className="logo">
          <img src={Logo} alt="logo" />
        </div>
        <div className="nav-items">
          <div>
            <a href="/">Home</a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
